import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { take, tap } from 'rxjs/operators';

import { Expenses } from './expenses.model';

@Injectable({
	providedIn: 'root'
})
export class ExpensesService {
	private _expenses = new BehaviorSubject<Expenses[]>([
		new Expenses(
			Math.random().toString(),
			'data:image/png;base64,',
			new Date('2019-11-20 09:40'),
			5.99
		),
		new Expenses(
			Math.random().toString(),
			'data:image/png;base64,',
			new Date('2019-11-20 11:50'),
			7.99
		),
		new Expenses(
			Math.random().toString(),
			'data:image/png;base64,',
			new Date('2019-11-20 13:34'),
			59.99
		)
	]);

	get expenses() {
		return this._expenses.asObservable();
	}

	constructor() {}


	addExpense(image: string, dateOfExpense: Date, amount: number) {
		const newExpense = new Expenses(Math.random().toString(), image, dateOfExpense, amount);
		this.expenses.pipe(take(1)).subscribe(expenses => {
			this._expenses.next(expenses.concat(newExpense));
		});
	}

	deleteExpense(expenseId: string) {
		return this.expenses.pipe(
			take(1),
			tap(expenses => {
				this._expenses.next(expenses.filter(e => e.id !== expenseId));
			})
		);
	}
}